            let fields = ["elevation"];
            let aliases = ["Elevation (m)"];
            return '<table>' +
            String(
                fields.map(
                columnname=>
                    `<tr style="text-align: left;">
                    <th style="padding: 4px; padding-right: 10px;">
                        ${aliases[fields.indexOf(columnname)]
                        }
                    </th>
                    
                    <td style="padding: 4px;">${handleObject(layer.feature.properties[columnname])
                    }</td></tr>`
                ).join(''))
                +'</table>'
            }, {"sticky": true});

        geo_json_fd1224c41b8a47228d0c881234623fdc.bindTooltip(
            function(layer){
            // Convert non-primitive to String.
            let handleObject = (feature)=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
            let fields = ["speed"];
            let aliases = ["Speed (km/h)"];
            return '<table>' +
            String(
                fields.map(
                columnname=>
                    `<tr style="text-align: left;">
                    <th style="padding: 4px; padding-right: 10px;">
                        ${aliases[fields.indexOf(columnname)]
                        }
                    </th>
                    
                    <td style="padding: 4px;">${handleObject(layer.feature.properties[columnname])
                    }</td></tr>`
                ).join(''))
                +'</table>'
            }, {"sticky": true});
